import React, { Component } from 'react'
import './SearchResult.css';

export class SearchResult extends React.Component {
    constructor(props){
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div>
               <div class="row">
                    <div class="column">
                        <h2>Column 1</h2>
                        <p>Some text..</p>
                    </div>
                    <div class="column">
                        <h2>Column 2</h2>
                        <p>Some text..</p>
                    </div>
                </div>
                <h2>Results</h2>
                <div class="column"><p>Group1</p></div><div class="column"><button>add</button></div>
                <div class="column"><p>Group2</p></div><div class="column"><button>add</button></div>
                <div class="column"><p>Group3</p></div><div class="column"><button>add</button></div>
                <div class="column"><p>Group4</p></div><div class="column"><button>add</button></div>
            </div>
        );
    }
}
